import React from 'react';
import ReactDOM from 'react-dom';

import axios from 'axios';

/* The function, App, is what react calls a Component. It can take a parameter, 
often called props, and has to return a template. This template is similar to 
the render functions we've used before. A component can be used anywhere a normal tag could be used*/
const App = () => {
    return (
      <div id="app">
        <SearchBar />
        <SearchResults />
        <DeckList />
      </div>
    );
}

ReactDOM.render(
  <App />,
  document.getElementById('root')
);
